import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import axios from "axios";

const Header = ({ sessionId, setSessionId }) => {
    const history = useHistory();
    const logoutRequest = async () => {
        try {
            await axios.get('http://localhost:1234/auth/logout');
            window.sessionStorage.clear();
            setSessionId(null);
            history.push("/login");
        }
        catch (e) {
            alert(e);
        }
    }
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <a className="navbar-brand" href="#!">RacerIn</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav">
                    <li className="nav-item">
                    <Link className="nav-link active" aria-current="page" to="/main">메인</Link>
                    </li>
                    <li className="nav-item">
                    <Link className="nav-link" to="/network">네트워크</Link>
                    </li>
                    <li className="nav-item">
                    <a className="nav-link" onClick={logoutRequest} href="#!">로그아웃</a>
                    </li>
                </ul>
                </div>
            </div>
        </nav>
    )

}

export default Header
